// poster, title, director, imdb rating
let movie_list = []
let url_list = []

export default class MoviePage extends Component {
    componentDidMount() {
        movie_list = movies.split(", ");
        for (var i = 0; i < movie_list.length; i++) {
            //console.log(movie_list[i]);
            //url_list.push("http://www.omdbapi.com/?apikey=3f1dca30&i=" + movie_list[i]);
            // fetch(url_list[i]).then(function(response) {
            //     console.log(response);
            // });
        }
        fetch("http://www.omdbapi.com/?apikey=3f1dca30&i=tt3896198")
            .then(response => response.json())
            .then(data => console.log(data['Title']));
    }

    render() {
        return (
            <div>
            <br/><br/>
            {movie_list}
          </div>
        )
    }
}
